import React from "react";

import "./navBar.styles.css";

const NavBar = () => (
  <div className="navBar">
    <img
      src="./images/bg-header-desktop.svg"
      alt="NavBar"
      width="200%"
      height="150px"
    />
  </div>
);

export default NavBar;
